import { Typography, Box, AppBar, Container, Toolbar } from '@material-ui/core';
import ForumIcon from '@mui/icons-material/Forum';
import Stack from '@mui/material/Stack';
import { makeStyles } from '@mui/styles';

import React from 'react';

const pages = ['MyThreads', 'MyComments']
const settings = ['Profile', 'Account', 'Logout', 'Sign In'];

const SearchAppBar: React.FC = () => {
  return (
    <Box marginBottom={'70px'}>
      <AppBar position='fixed' style={{zIndex: '3000'}}>
        <Container maxWidth='xl'>
          <Toolbar>
            <ForumIcon sx={{mr: 1}} />
            <Typography variant='h6' component='a' href='/'
              style={{
                color: 'inherit',
                textDecoration: 'none',
              }}
            >
              ChitChat
            </Typography>
            <Stack direction='row' >
              {pages.map(page => (
                <Typography>{page}</Typography>
              ))}
            </Stack>
          </Toolbar>
        </Container>
      </AppBar>
    </Box>
  );
};

export default SearchAppBar;
